import NoteItem from "./NoteItem";

const NoteList = ({ allNotes, newNote, allCategory }) => {
  const eachNote = allNotes.map();
  return <NoteItem newNote={newNote} allCategory={allCategory}></NoteItem>;
};

export default NoteList;
